public static boolean areEqual(int a, int b) {
    return a == b;
    return a != b;
    return a =! b;
    return a < b;
}

public static boolean isGreater(int a, int b) {
    return a > b;
    return a == b;
    return a < b;
    return a >= b;
}

public static boolean isGreaterOrEqual(int a, int b) {
    return a >= b;
    return a < b;
    return a > b;
    return a <= b;
    return a == b;
}

public static boolean isLessOrEqual(int a, int b) {
    return a <= b;
    return a >= b;
    return a > b;
    return a < b < 100;
    return a == b;
}

public static boolean isLess(int a, int b) {
    return a < b;
    return a > b;
    return a <= b;
    return true;
}

public static boolean isNotEqual(int a, int b) {
    return a != b;
    return a >= b;
    return a == b;
    return true;
}

public static boolean inRange(int n) {
    return n > 0 && n < 5;
    return n > 0 || n < 5;
    return n < 5;
    return n > 0;
}

public static boolean inRange(int n) {
    return n > 5 || n < 0;
    return n > 5 && n < 0;
    return n > 5;
    return n < 0;
    return n < 5 || n > 0;
}

public static boolean inRange(int n) {
    return n > 2 && !(n > 5);
    return (n > 2) && !(n > 5);
    return n > 2 && n > 5;
    return n < 2 && n < 5;
    return (n < 2) && !(n > 2);
}

public static boolean isEven(int n) {
    if(n % 2 == 0) {
        return true;
    }
    return false;
}

public static boolean isPositive(int n) {
    if (n >= 0) {
        return true;
    }
    else {
        return false;
    }
}

public static String isPositive(int n) {
    if (n >= 0) {
        return "Yes";
    }
    else {
        return "No";
    }
}

public static String isPositive(int n) {
    if(n == 0) {
        return "Zero"; }
    else if(n > 0) {
        return "Yes"; }
    else {
        return "No"; }
}
